VALUES ('3760122883390', 'Bûche framboise', 'Mousse framboise (43,82 %) : crème pasteurisée (crème (LAIT), stabilisant : carraghénanes), purée de framboise 10 % (framboise 9 %, sucre), eau, préparation pour meringue (sucre, sirop de glucose, blanc d\'OEUF en poudre, amidon modifié de pomme de terre), sucre, gélatine bovine, arôme naturel de framboise. Gelée framboise (18,08 %) : sirop de glucose-fructose, framboise, eau, épaississant : E407, sucre, gélifiants : E440i, arôme naturel, acidifiant : E331. Décors (11,27 %) : nappage (eau, sirop de glucose-fructose de blé, sucre, gélifiants : pectines, carraghénanes, acidifiants : acide citrique, phosphates de potassium, citrates de calcium), framboise, plaquette chocolat (sucre, beurre de cacao, poudre de _lait_ entier, colorant E120, émulsifiant : lécithine de _soja_, arôme vanille). Framboise (8,45 %). Biscuit (7,82 %) : farine de _froment_, blancs d\'OEUFS, sucre, jaunes d\'OEUFS, dextrose, sorbitol (E420), stabilisant (glycérol), sirop de sucre inverti, émulsifiants (mono et diglycérides d\'acides gras, esters polyglycériques d\'acides gras). Crème Chantilly (6,38 %) : crème pasteurisée (crème (LAIT), stabilisant : carraghénanes), sucre, extrait de vanille, gousse de vanille broyée en grains. Génoise (4,17 %) : préparation pour génoise (farine de blé (GLUTEN), sucre, sirop de glucose déshydraté, amidon de blé (GLUTEN), émulsifiants : lactoglycérides et acétoglycérides, poudres à lever : carbonate acide de sodium, diphosphates, sel, poudre de LAIT écrémé), OEUFS entiers pasteurisés, eau.', 'https://static.openfoodfacts.org/images/products/376/012/288/3390/front_fr.6.400.jpg', '', '', '', '', '', '', '', '', '', '0');

