VALUES ('3760122961234', 'Petites baguettes ', 'une délicieuse pâte sablée; une grosse cuillère de farine de _blé_, une poignée de sucre, du bon beurre frais (contient du _lait_) (7%), du miel, une pincée de sel (0,8%), de la poudre à lever pour aérer la texture : carbonate de sodium, une larme d\'_œuf_, de l\'émulsifiant pour garantir une bonne tenue de votre biscuit : lécithine et de l\'arôme naturel. Du bon chocolat (40%) : de la pâte de cacao, du sucre, du cacao maigre en poudre, de la matière grasse de _lait_ et de l\'émulsifiant pour améliorer la liaison de tous les ingrédients : lécithine de _soja_.', 'https://static.openfoodfacts.org/images/products/376/012/296/1234/front_fr.3.400.jpg', '20', '12.7', '63', '35.7', '', '5.5', '1.1', '0.433070866141732', '', '0');

