VALUES ('3760124190014', 'L\'authentique', 'Eau, sucre, sirop de glucose, arômes:  ANIS : arôme naturel anis (0,26%) (épaississant : gomme arabique, conservateur : benzoate de sodium),  CITRON : arôme naturel de limette (0,38%), acide citrique (028%), colorant jaune E160ai.  KOLA : colorant caramel E150d (acidifiant : acide citrique), arôme naturel kota (0,93%). FRAMBOISE : arôme framboise (0,38%), colorant E162  MENTHE : arôme naturel de menthe (0,13%), colorant vert E141 (anti-oxygène : acide ascorbique ; conservateur: benzoate de sodium).  ', 'https://static.openfoodfacts.org/images/products/376/012/419/0014/front_fr.6.400.jpg', '0', '0', '23', '20', '0', '0', '0', '0', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760124190021', 'Glace artisanale caramel au beurre sale', 'Pngrédients : Eau, caramel au beurre salé (22%) (eau, sucre, sirop de glucose, sucre glace, CREME )ilisant carraghénanes), BEURRE (2.8%), sel (0.25%)), sucre, LAIT écrémé en poudre, jaune d\'ŒUF EURRE, dextrose, sirop de glucose, maltodextrine, émulsifiants (mono-diglycérides dtacide gras), épaississants (farine de caroube ; alginate de sodium ; gomme de guar ; carraghénanes). Produit élaboré dans un laboratoire utilisant des fruits à coque, soja, gluten et arachide. À CONSOMMER DE PRÉFÉRENCE AVANT LE : voir sur emballage. Nous vous conseillons de sortir ce produit 10 minutes avant dégustation afin d\'en apprécier tous les arômes. Conservation : Plusieurs mois au congélateur à -180, ne jamais recongeler un produit décongelé. 3/4 pers. * poids net minimum garanti Produit fabriqué par la SARL ALFAGEL MIN des Arnavaux 13014 Marseille FR 13.214.057 www.maisondelaglace.com CE', 'https://static.openfoodfacts.org/images/products/376/012/419/0021/front_fr.4.400.jpg', '7.9', '5', '31', '28', '', '3.8', '0.37', '0.145669291338583', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
